//选择单选或多选投票的界面
import { Link } from "react-router-dom";
import './Create.css'

export default function Create(){
  return(
    <div>
      <div className="card">
      <Link to="/create-vote">创建单选</Link>
      </div>
      <div className="card">
      <Link to="/create-vote?multiple=1">创建多选</Link>
      </div>
    </div>
  )
}
